import Header from "./Header";
import Footer from "./Footer";
import Mid from "./Mid";
import pic from './logo.svg'


export default function App(){
    return(
        <div>
        <Header/>
        <Mid img={pic}
                name='ameen'/>
        <Mid img='logo192.png'
                name='rahul'/>
                
        <Mid img='logo192.png'
                name='rahul'/>
        <Footer/>
        </div>

    );
}
